import React, { useState } from "react";
import { Button, Container } from "react-bootstrap";
import CreateBrand from "../components/modals/CreateBrand";
import CreateDevice from "../components/modals/CreateDevice";
import CreateType from "../components/modals/CreeateType";

const Admin = () => {

    return (
        <Container className="d-flex flex-column">
            <Button variant="outline-primary" className="mt-5 p-2">
                Добавить категорию
            </Button>
            <Button variant="outline-primary" className="mt-4 p-2">
                Добавить бренд
            </Button>
            <Button variant="outline-primary" className="mt-4 p-2">
                Добавить устройство
            </Button>
            <CreateBrand />
            <CreateDevice />
            <CreateType show={true} />
        </Container>       
    )
}

export default Admin;
